window.bookSummaryJSON = "<p>Why don't thieves and mages get along?</p> <p>Because thieves remind mages too much of themselves.</p> <p>Thief Kaylin is trying to keep her crew alive in Waypoint, the last bastion of civilization before the remains of a once-great half-elven city in the shadows of Ziammotienth. Many venture out to the ruins. Most do not return.</p> <p>Is Tolan's Doom just a legend, or is it much more? Adventure and intrigue swirl around Kaylin as she fights for her crew and gets into more trouble than she could ever have expected.</p> <p>Her world is changing, whether she wants it to or not.</p> <p>Because everyone has to live...and die...somewhere.</p>"; 
